import React from "react";
import ReactDOM from "react-dom";
import "./index.css";
import App from "./App";
import { Provider } from "react-redux";
import store from "./Redux/Store/Store";

ReactDOM.render(

  <React.StrictMode>
    <Provider store={store}>
    <Router>
    <App />
    </Router>


    </Provider>
  </React.StrictMode>,
  document.getElementById("root")
);
